import React from 'react';
import { Link } from 'react-router-dom';
import { useUser } from '../contexts/UserContext';  // Ensure the import path is correct

function Navbar() {
    const { user } = useUser();  // Destructure user from context

    return (
        <nav>
            <div className="logo">
                <img src="/Images/logo.jpg" alt="Restaurant Logo" />
            </div>
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/menu-items">Menu Items</Link></li>
                <li><Link to="/orders">Orders</Link></li>
                {user && user.role === 'admin' && (
                    <li><Link to="/manage">Manage</Link></li>
                )}
                {user ? (
                    <li><Link to="/logout">Logout</Link></li>
                ) : (
                    <>
                        <li><Link to="/signup">Sign Up</Link></li>
                        <li><Link to="/login">Login</Link></li>
                    </>
                )}
            </ul>
        </nav>
    );
}

export default Navbar;
